import React from 'react';

function Education() {
  return (
    <section id="education" style={{ marginLeft: "10px", display: "flex", alignItems: "center", flexDirection: "column" }}>
      <h2>Education</h2>
      
        <p>• Bachelor's Degree in Computer Science, XYZ University, 2015-2019</p>
        <p>• Master's Degree in Computer Engineering, ABC University, 2019-2021</p>
      
    </section>
  );
}

export default Education;
